tables.ddl:
CREATE TABLE public.adventureworksdwbuildversion (
	dbversion varchar(50) NULL,
	versiondate timestamp NULL
);

CREATE TABLE public.dimcurrency (
	currencykey int4 DEFAULT nextval('dimcurrency_seq'::regclass) NOT NULL,
	currencyalternatekey bpchar(3) NOT NULL,
	currencyname varchar(50) NOT NULL,
	CONSTRAINT pk_dimcurrency_currencykey PRIMARY KEY (currencykey)
);
CREATE UNIQUE INDEX ak_dimcurrency_currencyalternatekey ON public.dimcurrency USING btree (currencyalternatekey);

CREATE TABLE public.dimproductcategory (
	productcategorykey int4 DEFAULT nextval('dimproductcategory_seq'::regclass) NOT NULL,
	productcategoryalternatekey int4 NULL,
	englishproductcategoryname varchar(50) NOT NULL,
	spanishproductcategoryname varchar(50) NOT NULL,
	frenchproductcategoryname varchar(50) NOT NULL,
	CONSTRAINT pk_dimproductcategory_productcategorykey PRIMARY KEY (productcategorykey)
);
CREATE UNIQUE INDEX ak_dimproductcategory_productcategoryalternatekey ON public.dimproductcategory USING btree (productcategoryalternatekey);

CREATE TABLE public.dimsalesterritory (
	salesterritorykey int4 DEFAULT nextval('dimsalesterritory_seq'::regclass) NOT NULL,
	salesterritoryalternatekey int4 NULL,
	salesterritoryregion varchar(50) NOT NULL,
	salesterritorycountry varchar(50) NOT NULL,
	salesterritorygroup varchar(50) NULL,
	salesterritoryimage bytea NULL,
	CONSTRAINT pk_dimsalesterritory_salesterritorykey PRIMARY KEY (salesterritorykey)
);
CREATE UNIQUE INDEX ak_dimsalesterritory_salesterritoryalternatekey ON public.dimsalesterritory USING btree (salesterritoryalternatekey);

CREATE TABLE public.dimscenario (
	scenariokey int4 DEFAULT nextval('dimscenario_seq'::regclass) NOT NULL,
	scenarioname varchar(50) NULL,
	CONSTRAINT pk_dimscenario PRIMARY KEY (scenariokey)
);

CREATE TABLE public.factadditionalinternationalproductdescription (
	productkey int4 NOT NULL,
	culturename varchar(50) NOT NULL,
	productdescription text NOT NULL,
	CONSTRAINT pk_factadditionalinternationalproductdescription_productkey_cul PRIMARY KEY (productkey, culturename)
);

CREATE TABLE public.sysdiagrams (
	"name" varchar(128) NOT NULL,
	principal_id int4 NOT NULL,
	diagram_id int4 DEFAULT nextval('sysdiagrams_seq'::regclass) NOT NULL,
	"version" int4 NULL,
	definition bytea NULL,
	CONSTRAINT pk__sysdiagr__c2b05b616b24ea82 PRIMARY KEY (diagram_id)
);
CREATE UNIQUE INDEX uk_principal_name ON public.sysdiagrams USING btree (principal_id, name);

CREATE TABLE public.vassocseqlineitems (
	ordernumber varchar(20) NOT NULL,
	linenumber int2 NOT NULL,
	model varchar(50) NULL
);

CREATE TABLE public.vassocseqorders (
	ordernumber varchar(20) NOT NULL,
	customerkey int4 NOT NULL,
	region varchar(50) NULL,
	incomegroup varchar(8) NOT NULL
);

CREATE TABLE public.factsurveyresponse (
	surveyresponsekey int4 DEFAULT nextval('factsurveyresponse_seq'::regclass) NOT NULL,
	datekey int4 NOT NULL,
	customerkey int4 NOT NULL,
	productcategorykey int4 NOT NULL,
	englishproductcategoryname varchar(50) NOT NULL,
	productsubcategorykey int4 NOT NULL,
	englishproductsubcategoryname varchar(50) NOT NULL,
	"date" timestamp NULL,
	CONSTRAINT pk_factsurveyresponse_surveyresponsekey PRIMARY KEY (surveyresponsekey),
	CONSTRAINT fk_factsurveyresponse_customerkey FOREIGN KEY (customerkey) REFERENCES public.dimcustomer(customerkey),
	CONSTRAINT fk_factsurveyresponse_datekey FOREIGN KEY (datekey) REFERENCES public.dimdate(datekey)
);
CREATE INDEX ix_factsurveyresponse_customerkey ON public.factsurveyresponse USING btree (customerkey);
CREATE INDEX ix_factsurveyresponse_datekey ON public.factsurveyresponse USING btree (datekey);
CREATE INDEX ix_factsurveyresponse_productsubcategorykey ON public.factsurveyresponse USING btree (productsubcategorykey);
